    [],nt"num_tags": 0,nt"name": "temperature-salinity-and-other-variables-collected-from-discrete-sample-and-profile-observation5bf68",nt"isopen":
    false,nt"url": null,nt"notes": "NCEI Accession 0143949 includes discrete
    sample and profile data collected from AURORA AUSTRALIS in the Indian Ocean and
    Southern Oceans (> 60 degrees South) from 2012-01-05 to 2012-02-12. These data include
    DISSOLVED OXYGEN, FLUORESCENCE, HYDROSTATIC PRESSURE, NITRATE, PHOTOSYNTHETIC ACTIVE
    RADIATION (PAR), Potential temperature (theta), SALINITY, WATER TEMPERATURE, phosphate
    and silicate. The instruments used to collect these data include CTD, PAR Sensor
    and bottle.nnThese data were collected by Mark Rosenberg of Antarctic Climate &
    Ecosystems Cooperative Research Centre and Stephen R. Rintoul of Commonwealth Scientific
    and Industrial Research Organization as part of the CLIVAR_I09S_09AR20120105 data
    set. CDIAC associated the following cruise ID(s) with this data set: CLIVAR_I09S_2012
    and U1203nnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography Program
